import React from 'react';
import styles from './Pages.module.css';

const BiographyPage = () => {
  return (
    <div>
      <h2 className={styles['dancing-script']}>Biography</h2>
      <p className={styles['pages-content']}>
        <span ></span>
      </p>
    </div>
  );
};

export default BiographyPage;
